import React from 'react';
import { TextField, Button } from '@mui/material';

function Contact() {
    return (
        <div className='container'>
            <div className='text-[#fff] px-2 py-1 mb-4 rounded-md font-semibold text-lg' style={{ background: 'linear-gradient(90deg, rgba(255,99,0,1) 0%, rgba(255,194,103,1) 100%)' }}>
                Contact Us
            </div>
            <span className='font-semibold'>Have a query ? Fill the below we will get back to you. </span>
            <div className='py-6'>
                <form className='space-y-4 mb-5'>
                    <TextField
                        label="Name"
                        variant="outlined"
                        fullWidth
                        InputLabelProps={{ style: { color: '#333' } }}
                        InputProps={{ style: { color: '#333' } }}
                    />
                    <TextField
                        label="Email"
                        type="email"
                        variant="outlined"
                        fullWidth
                        InputLabelProps={{ style: { color: '#333' } }}
                        InputProps={{ style: { color: '#333' } }}
                    />
                    <TextField
                        label="Subject"
                        variant="outlined"
                        fullWidth
                        InputLabelProps={{ style: { color: '#333' } }}
                        InputProps={{ style: { color: '#333' } }}
                    />
                    <TextField
                        label="Message"
                        variant="outlined"
                        fullWidth
                        multiline
                        rows={4}
                        InputLabelProps={{ style: { color: '#333' } }}
                        InputProps={{ style: { color: '#333' } }}
                    />
                    <Button
                        type="submit"
                        variant="contained"
                        color="primary"
                        style={{ backgroundColor: '#00ccff', color: '#fff' }}
                    >
                        Send Message
                    </Button>
                </form>


            <span className='font-semibold'>Follow us on our social media handles </span>
            <FacebookIcon fill="#3b5998" /> 


            </div>
        </div>
    );
}

export default Contact;





function FacebookIcon(props) {
    return (
      <svg
        {...props}
        xmlns="http://www.w3.org/2000/svg"
        width="24"
        height="24"
        viewBox="0 0 24 24"
        fill="none"
        stroke="currentColor"
        strokeWidth="2"
        strokeLinecap="round"
        strokeLinejoin="round"
      >
        <path d="M18 2h-3a5 5 0 0 0-5 5v3H7v4h3v8h4v-8h3l1-4h-4V7a1 1 0 0 1 1-1h3z" />
      </svg>
    );
  }

  function InstagramIcon(props) {
    return (
      <svg
        {...props}
        xmlns="http://www.w3.org/2000/svg"
        width="24"
        height="24"
        viewBox="0 0 24 24"
        fill="none"
        stroke="currentColor"
        strokeWidth="2"
        strokeLinecap="round"
        strokeLinejoin="round"
      >
        <rect width="20" height="20" x="2" y="2" rx="5" ry="5" />
        <path d="M16 11.37A4 4 0 1 1 12.63 8 4 4 0 0 1 16 11.37z" />
        <line x1="17.5" x2="17.51" y1="6.5" y2="6.5" />
      </svg>
    );
  }
